package main

import (
	"fmt"
	"io/ioutil"
	"log"
	"net/http"
	"strings"
)

func main() {

	url := "https://storage.bunnycdn.com/vediagames/vediagames/testwiwww.jpeg"

	payload := strings.NewReader("data:image/jpeg;name=2022-05-15%2023.49.11.jpg;base64,")

	req, err := http.NewRequest("PUT", url, payload)
	if err != nil {
		log.Println(err)
	}
	req.Header.Add("AccessKey", "88800820-6c69-4dba-9a3919b168f5-dbc5-4262")
	req.Header.Add("content-type", "application/octet-stream")

	res, err := http.DefaultClient.Do(req)
	if err != nil {
		log.Println(err)
	}
	defer res.Body.Close()
	body, err := ioutil.ReadAll(res.Body)
	if err != nil {
		log.Println(err)
	}
	fmt.Println(res)
	fmt.Println(string(body))

}
